    const [old, setNew] = useState(() => {props.items.forEach(element => {

        old.push(<ExpenseItem
        id={element.id}
        title={element.title}
        amount={element.amount} 
        date={element.date}
        location={element.location}
        />)

    })});

    const result = [];

    console.log(props);
