        result.push(<ExpenseItem
        id={element.id}
        title={element.title}
        amount={element.amount} 
        date={element.date}
        location={element.location}
        />)

    })

    return(
        <Card className='expenses'>
            {old}
        </Card>
    )

}

export default Expenses;
